import "./Toggle.css";
function Toggle() {
  return (
    <div class="outer my-5">
      <div class="togglecontainer">
        <button type="button" className="btn custom btn-lg">
          Trending
        </button>

        <button type="button" className="btn custom btn-lg">
          Latest
        </button>
      </div>
      <div class="toggle">
        <button type="button" className="btn custom btn-lg">
          Create Blog
        </button>
      </div>
      //{" "}
    </div>
  );
}

export default Toggle;
